16.6.5.1 Using renderPlot(): make a plot

library(ggplot2)

ggplot(mpg) +
  geom_point(
    aes(x = displ, y = hwy, color = class))








Link plot to output with output$&lt;id&gt;
ui

ui &lt;- fluidPage(
  sidebarLayout(
    sidebarPanel(
      radioButtons(‚Ä¶) 
    ), 
    mainPanel(
      plotOutput( #&lt;&lt;
        outputId = "mpg_plot" #&lt;&lt;
      ) #&lt;&lt;
    )
  )
)

server

server &lt;- function(input, output, session) {
  output$mpg_plot &lt;- renderPlot({ #&lt;&lt;
    ggplot(mpg) +
      geom_point(
        aes(x = displ, y = hwy, color = class))
  })
}

Link user inputs to plot with input$&lt;id&gt;
ui

ui &lt;- fluidPage(
  sidebarLayout(
    sidebarPanel(
      radioButtons(
        inputId = "xvar", #&lt;&lt;
        label = "Select the x-axis variable:",
        selected = "displ",
        choices = c(
          "Highway miles per gallon" = "hwy", #&lt;&lt;
          "City miles per gallon" = "cty", #&lt;&lt;
          "Engine displacement, in litres" = "displ") #&lt;&lt;
      ),
    ), 
    mainPanel(
      plotOutput(
        outputId = "mpg_plot" 
      ) 
    )
  )
)

server

server &lt;- function(input, output, session) {
  output$mpg_plot &lt;- renderPlot({ 
    ggplot(mpg) +
      geom_point(
        aes_string( #&lt;&lt;
          x = input$xvar,  #&lt;&lt;
          y = "hwy", 
          color = "class")) 
  })
}

Note: I switched the ggplot code fromaes() to aes_string()
